import navi from "../../assets/navi-1.jpg";

export const Home = () => {
  return (
    <div id="home">
      <img src={navi} alt="navi" className="sidebar--img" />
      <h1 className="name">
        navdeep<span style={{ color: "#999999" }}>.</span>
      </h1>
    </div>
  );
};
